 @DCLahore @UsmanAKBuzdar @ImranKhanPTI @CaptainUsman @GovtofPunjabPK @Asad_Umar @GovtofPakistan @fslsltn @HealthPunjabGov @Dr_YasminRashid 
#CovidVaccine #COVID19

@jimcramer We have mandates everywhere. 

Seatbelt is a mandate. Employees must wash their hands is a mandate. No smoking indoors, on a plane, or near a gas pump is a mandate.

We chose not to make #CovidVaccine a mandate not because it makes us less free, but it hurts our fragile egos.
